import Box from '@mui/material/Box';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemText from '@mui/material/ListItemText';
import ListSubheader from '@mui/material/ListSubheader';
import Divider from '@mui/material/Divider';
import classNames from 'classnames';


function StackedNavbar(props) {
  const offWhite = getComputedStyle(document.body).getPropertyValue('--off-white');
  const blue2 = getComputedStyle(document.body).getPropertyValue('--blue2');
  const orange = getComputedStyle(document.body).getPropertyValue('--orange');
  const items = props.items;
  const subHeader = props.subHeader;
  
  let button = (key, value) => {
    return (
      <ListItem key={key} disablePadding>
        <ListItemButton
          className='stackedNavbar-btn highlight-text'
          disabled={props.currentSection === key ? true : false}
          onClick={() => props.changeSection(key, value)}
        >
          <ListItemText className='stackedNavbar-item' primary={value} />
        </ListItemButton>
      </ListItem>
    )
  };

  let label = (key, value) => {
    return (
      <ListItem key={key} disablePadding>
        {/* <ListItemButton
          className='stackedNavbar-btn'
          disabled={props.currentSection === key ? true : false}
          onClick={() => props.changeSection(key, value)}
        > */}
          <ListItemText className='stackedNavbar-item highlight-text' primary={value} />
        {/* </ListItemButton> */}
      </ListItem>
    )
  };

  const createListItem = (key, value) => {
    if (props.clickable) {
      // return(
      //   <ListItem key={key} disablePadding>
      //     <ListItemButton
      //       className='stackedNavbar-btn'
      //       disabled={props.currentSection === key ? true : false}
      //       onClick={() => props.changeSection(key, value)}
      //     >
      //       <ListItemText className='stackedNavbar-item' primary={value} />
      //     </ListItemButton>
      //   </ListItem>
      // );
      return button(key, value);
    } else {
      return label(key, value);
    }
    return(
      <ListItem key={key} disablePadding>
        <ListItemButton
          className='stackedNavbar-btn'
          disabled={props.currentSection === key ? true : false}
          onClick={() => props.changeSection(key, value)}
        >
          <ListItemText className='stackedNavbar-item' primary={value} />
        </ListItemButton>
      </ListItem>
    );
  }

  return (
    <div className='stackedNavbar'>
      <Box
        sx={{ width: '100%'}}
        role="presentation"
      >
        <List
          component="nav"
          aria-labelledby="nested-list-subheader"
          subheader={
            <ListSubheader sx={{background: 'rgba(0, 0, 0, 0)', color: offWhite, textAlign: 'left'}} component="div" id="nested-list-subheader">
              {subHeader}
              <Divider
                variant='left'
                sx={{
                  borderColor: blue2,
                  width: '60%',
                  borderWidth: '1px'
                }}
              >
              </Divider>
            </ListSubheader>
          }
        >
          {Object.entries(items).map(([key, value]) => createListItem(key, value))}
        </List>
      </Box>
    </div>
  );
}

export default StackedNavbar;
